<!DOCTYPE html>
<meta charset="utf-8">
<title>CAO Caseload Growth by Year</title>
<link rel="stylesheet" type="text/css" href="https://unpkg.com/@observablehq/notebook-inspector@1/dist/notebook-inspector-style.css">
<body>
<script type="module">

import {Inspector, Runtime} from "https://unpkg.com/@observablehq/notebook-runtime@1?module";
import notebook from "./cao-caseload-growth-by-year.js";

Runtime.load(notebook, (cell) => {
  if (cell.name === "chart") {
    return {
      fulfilled: (value) => {
        document.getElementById("chart").appendChild(value);
      }
    };
  }
});

</script>
